import React from 'react'
import ReactDOM from 'react-dom'
import Cards from './components/Cards'
import 'bootstrap/dist/css/bootstrap.min.css'
import axios from 'axios'

const container = document.getElementById('root')

function takeCur(){
    axios.get('https://free.currconv.com/api/v7/convert?apiKey=do-not-use-this-key&q=EUR_ARS,USD_ARS')
  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  });
}

ReactDOM.render(<Cards
                notaTitle="Nota 2:37 PM"
                notaBody="Esta es una nota de 10 puntos."
                leftColor="#A74CF2"
                rightColor="#617BFB"
                img="https://reactstrap.github.io/assets/logo.png"
                 />,container)
